      <Router>{path}
      <Vehicleview/>
      <div
      style={{
        display:"flex",
        flexDirection:"row",
        justifyContent:"space-around",
        width:"100%",

        border:"2px solid black",
        backgroundColor:"red"
      }}
      ><VehicleStatus/><LineChart/></div>
      <TripTable/>

        <Routes> 
          <Route path ='/' element ={<Navigate to ='/home'/>}/>
          {/* <Route path ='/home' element={<Home/>}/>
